INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1120,'de',' Klassische Expo Salzburg','<p><strong>\"<span style=\"color:#333333; font-family:Roboto,sans-serif; font-size:15px\">Die Vintage-Ära in der Automobilwelt war eine Zeit des Übergangsn</span>.\"</strong></p>\n\n<p><span style=\"color:#333333; font-family:Roboto, sans-serif\"><span style=\"font-size:15px\">Das Auto startete 1919 noch als Rarität und endete 1930 auf dem Weg zur Allgegenwart. Tatsächlich war die Automobilproduktion am Ende dieses Zeitraums erst in den 1950er Jahren wieder vergleichbar. In den vergangenen Jahren bauten die meisten Industrieländer landesweite Straßensysteme auf, so dass die Fähigkeit, unbefestigte Straßen zu befahren, gegen Ende des Zeitraums nicht mehr im Vordergrund des Autodesigns stand.</span></span></p>\n');
INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1120,'en','Classic Expo Salzburg','<p><strong>\"<span style=\"color:#333333; font-family:Roboto,sans-serif; font-size:15px\">The vintage era in the automotive world was a time of transition</span>.\"</strong><br />\n<span style=\"color:#333333; font-family:Roboto, sans-serif\"><span style=\"font-size:15px\">The car started off in 1919 as still something of a rarity, and ended up, in 1930, well on the way towards ubiquity. In fact, automobile production at the end of this period was not matched again until the 1950s. In the intervening years, most industrialized countries built nationwide road systems with the result that, towards the end of the period, the ability to negotiate unpaved roads was no longer a prime consideration of automotive design.</span></span></p>\n');
INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1120,'fr',NULL,NULL);
INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1121,'de','Auto Messe Salzburg \'19','<p><strong>\"Internationale Oldtimermesse.\"</strong></p>\n\n<p><span style=\"color:#333333; font-family:Roboto,sans-serif\"><span style=\"font-size:15px\">Ein Oldtimer ist im weitesten Sinne ein altes Automobil, und im engeren Sinne von Autoenthusiasten und Sammlern ist es ein Auto aus der Zeit von 1919 bis 1930. Solche Enthusiasten haben Kategorisierungsschemata für das Alter von Autos, die Unterscheidungen erzwingen zwischen antiken Autos, Oldtimern, Oldtimern und so weiter. Die Einstufungskriterien variieren, aber innerhalb eines Landes wird der Konsens häufig von großen Autoclubs gewahrt, beispielsweise dem Vintage Sports-Car Club (VSCC) in Großbritannien.</span></span></p>\n');
INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1121,'en','Auto Fair Salzburg \'19','<p><strong>\"International vintage car&nbsp;fair.\"</strong></p>\n\n<p><span style=\"color:#333333; font-family:Roboto, sans-serif\"><span style=\"font-size:15px\">A vintage car is, in the most general sense, an old automobile, and in the narrower senses of car enthusiasts and collectors, it is a car from the period of 1919 to 1930. Such enthusiasts have categorization schemes for ages of cars that enforce distinctions between antique cars, vintage cars, classic cars, and so on. The classification criteria vary, but consensus within any country is often maintained by major car clubs, for example the Vintage Sports-Car Club (VSCC) in the UK.</span></span></p>\n');
INSERT INTO object_localized_data_EV (`ooo_id`,`language`,`title`,`description`) VALUES (1121,'fr',NULL,NULL);
